import React, { useRef } from 'react';

import Header from '@/components/Header';
import Select from '@/components/Select';
import SEO from '@/components/SEO';
import Sidebar from '@/components/Sidebar';
import { Flex } from '@chakra-ui/core';
import { FormHandles } from '@unform/core';
import { Form } from '@unform/web';

interface IFormData {
  email: string;
  password: string;
}

const Dashboad: React.FC = () => {
  const formRef = useRef<FormHandles>(null);
  return (
    <>
      <SEO
        title="Lafe"
        image="og/boost.png"
        shouldExcludeTitleSuffix
        description="Fazer Dashboad na plataforma"
      />

      <Flex
        as="main"
        height="100vh"
        direction="column"
        backgroundColor="blue.500"
      >
        <Header />
        <Flex height="100%">
          <Sidebar />
          <Flex width="100%" height="100%">
            <Form ref={formRef} onSubmit={() => {}}>
              <Select
                backgroundColor="White"
                name="construction"
                placeholder="Selecione a obra"
                containerProps={{
                  marginLeft: '16px',
                  border: '1px solid',
                  borderColor: 'gray.400',
                  bg: 'white',
                }}
              >
                <option value="Obra1">Obra1</option>
                <option value="Obra2">Obra2</option>
                <option value="Obra3">Obra3</option>
              </Select>
              <Select
                backgroundColor="White"
                name="month"
                placeholder="Selecione o mês"
                containerProps={{
                  marginLeft: '16px',
                  border: '1px solid',
                  borderColor: 'gray.400',
                  bg: 'white',
                }}
              >
                <option value="Mês1">Mês1</option>
                <option value="Mês2">Mês2</option>
                <option value="Mês3">Mês3</option>
              </Select>
            </Form>
          </Flex>
        </Flex>
      </Flex>
    </>
  );
};

export default Dashboad;
